  {
    type: "users",
    text: "Total Users",
    color: "gradient-danger",
    icon: "cil-people",
  },
  { text: "Total Users", color: "gradient-danger", icon: "cil-people" },
  { text: "Total Users", color: "gradient-danger", icon: "cil-people" },
  { text: "Total Users", color: "gradient-danger", icon: "cil-people" },
